   * @type {boolean}
   */
  get culturalVictory() {
    return this._getPropertyIfDefined('culturalVictory');
  }

  set culturalVictory(newValue) {
    this._properties.culturalVictory.setValue(this._saveData, newValue);
  }

  /**
